// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/utils/Counters.sol';

contract DappVotes is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private totalPolls;
    Counters.Counter private totalContestants;

    struct PollStruct {
        uint id;
        string image;
        string title;
        string description;
        uint votes;
        uint contestants;
        bool deleted;
        address director;
        uint startsAt;
        uint endsAt;
        uint timestamp;
        address[] voters;
        string[] avatars;
    }

    struct ContestantStruct {
        uint id;
        string image;
        string name;
        address voter;
        uint votes;
        address[] voters;
    }

    mapping(uint => bool) public pollExists;
    mapping(uint => PollStruct) public polls;
    mapping(uint => mapping(address => bool)) voted;
    mapping(uint => mapping(address => bool)) contested;
    mapping(uint => mapping(uint => ContestantStruct)) contestants;

    event Voted(address indexed voter, uint timestamp);
    event PollCreated(uint pollId, address director);
    event PollUpdated(uint pollId);
    event PollDeleted(uint pollId);
    event ContestantAdded(uint pollId, uint contestantId);
    event VoteCasted(uint pollId, uint contestantId, address voter);

    modifier onlyPollDirector(uint pollId) {
        require(polls[pollId].director == msg.sender, "You are not the director of this poll");
        _;
    }

    modifier onlyDuringPoll(uint pollId) {
        require(currentTime() > polls[pollId].startsAt && currentTime() < polls[pollId].endsAt, "Voting is not allowed at this time");
        _;
    }

    modifier notDeleted(uint pollId) {
        require(!polls[pollId].deleted, "Poll has been deleted");
        _;
    }

    modifier hasNotVoted(uint pollId) {
        require(!voted[pollId][msg.sender], "You have already voted in this poll");
        _;
    }

    modifier canContest(uint pollId) {
        require(polls[pollId].votes < 1, "Poll has votes, cannot be contested");
        require(!contested[pollId][msg.sender], "You have already contested in this poll");
        _;
    }

    function createPoll(
        string memory image,
        string memory title,
        string memory description,
        uint startsAt,
        uint endsAt
    ) public {
        require(bytes(title).length > 0, "Title is required");
        require(bytes(description).length > 0, "Description is required");
        require(bytes(image).length > 0, "Image is required");
        require(startsAt > 0, "Start date is required");
        require(endsAt > startsAt, 'End date must be greater than start date');

        totalPolls.increment();
        uint pollId = totalPolls.current();

        PollStruct memory poll;
        poll.id = pollId;
        poll.title = title;
        poll.description = description;
        poll.image = image;
        poll.startsAt = startsAt;
        poll.endsAt = endsAt;
        poll.director = msg.sender;
        poll.timestamp = currentTime();

        polls[pollId] = poll;
        pollExists[pollId] = true;

        emit PollCreated(pollId, msg.sender);
    }

    function updatePoll(
        uint id,
        string memory image,
        string memory title,
        string memory description,
        uint startsAt,
        uint endsAt
    ) public onlyPollDirector(id) notDeleted(id) {
        require(bytes(title).length > 0, "Title is required");
        require(bytes(description).length > 0, "Description is required");
        require(bytes(image).length > 0, "Image is required");
        require(endsAt > startsAt, 'End date must be greater than start date');
        require(polls[id].votes == 0, "Poll has votes, cannot be updated");

        polls[id].title = title;
        polls[id].description = description;
        polls[id].image = image;
        polls[id].startsAt = startsAt;
        polls[id].endsAt = endsAt;

        emit PollUpdated(id);
    }

    function deletePoll(uint id) public onlyPollDirector(id) notDeleted(id) {
        require(polls[id].votes == 0, "Poll has votes, cannot be deleted");

        polls[id].deleted = true;

        emit PollDeleted(id);
    }

    function contest(uint pollId, string memory name, string memory image) public onlyDuringPoll(pollId) canContest(pollId) {
        require(bytes(name).length > 0, "Name is required");
        require(bytes(image).length > 0, "Image is required");

        totalContestants.increment();
        uint contestantId = totalContestants.current();

        ContestantStruct memory contestant;
        contestant.name = name;
        contestant.image = image;
        contestant.voter = msg.sender;
        contestant.id = contestantId;

        contestants[pollId][contestantId] = contestant;
        contested[pollId][msg.sender] = true;
        polls[pollId].avatars.push(image);
        polls[pollId].contestants++;

        emit ContestantAdded(pollId, contestantId);
    }

    function vote(uint pollId, uint contestantId) public onlyDuringPoll(pollId) notDeleted(pollId) hasNotVoted(pollId) {
        require(polls[pollId].contestants > 1, "Not enough contestants to vote");

        polls[pollId].votes++;
        polls[pollId].voters.push(msg.sender);

        contestants[pollId][contestantId].votes++;
        contestants[pollId][contestantId].voters.push(msg.sender);
        voted[pollId][msg.sender] = true;

        emit VoteCasted(pollId, contestantId, msg.sender);
    }

    function getPoll(uint id) public view returns (PollStruct memory) {
        return polls[id];
    }

    function getPolls() public view returns (PollStruct[] memory) {
        uint available;
        for (uint i = 1; i <= totalPolls.current(); i++) {
            if (!polls[i].deleted) {
                available++;
            }
        }
        PollStruct[] memory Polls = new PollStruct[](available);
        uint index;

        for (uint i = 1; i <= totalPolls.current(); i++) {
            if (!polls[i].deleted) {
                Polls[index++] = polls[i];
            }
        }
        return Polls;
    }

    function getContestants(uint pollId) public view returns (ContestantStruct[] memory) {
        uint available;
        for (uint i = 1; i <= totalContestants.current(); i++) {
            if (contestants[pollId][i].id == i) {
                available++;
            }
        }
        ContestantStruct[] memory Contestants = new ContestantStruct[](available);
        uint index;

        for (uint i = 1; i <= totalContestants.current(); i++) {
            if (contestants[pollId][i].id == i) {
                Contestants[index++] = contestants[pollId][i];
            }
        }
        return Contestants;
    }

    function currentTime() internal view returns (uint256) {
        return block.timestamp; // Time in seconds (not milliseconds)
    }
}

